import React from 'react'
import './App.css'
import FoodCard from './FoodCard'
const SearchResult = ({data}) => {
  return (
    <div className='search_result'>
      {data.map((value,index)=>{
        <FoodCard1 key = {index}>
        <div className='foodImg'>
        <img src= {value.image} alt="" />
        </div>
        </FoodCard1>
      })}
      
    </div>
  )
}

export default SearchResult
